import React from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";

function NewTicketForm() {
  return (
    <>
      <IndexNavbar />

      <div style={pageWrapper}>
        <div style={ticketCard}>
          <div style={headerSection}>
            <h1 style={titleStyle}>üé´ Nouveau Ticket STB</h1>
            <button style={returnButtonStyle}>
              ‚Üê Retour √† la liste
            </button>
          </div>

          <div style={formSection}>
            <div style={inputGroup}>
              <label style={labelStyle}>üìù Sujet</label>
              <input
                type="text"
                placeholder="Ex: Mon acc√®s internet est bloqu√©"
                style={inputStyle}
              />
            </div>

            <div style={inputGroup}>
              <label style={labelStyle}>üè¢ D√©partement</label>
              <select style={selectStyle}>
                <option>IT - Informatique</option>
                <option>RH - Ressources Humaines</option>
                <option>Comptabilit√©</option>
              </select>
            </div>

            <div style={inputGroup}>
              <label style={labelStyle}>üìÑ Description</label>
              <textarea
                rows="5"
                placeholder="D√©crivez votre probl√®me ici..."
                style={textareaStyle}
              />
            </div>

            <div style={createButtonContainer}>
              <button style={createButtonStyle}>üì® Cr√©er le ticket</button>
            </div>
          </div>
        </div>
      </div>

      <Footerr />
    </>
  );
}

// üé® Styles modernis√©s et harmonis√©s
const pageWrapper = {
  fontFamily: "'Segoe UI', sans-serif",
  background: "#f0f4f8",
  minHeight: "100vh",
  padding: "3rem 1rem",
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
};

const ticketCard = {
  background: "#ffffff",
  borderRadius: "16px",
  boxShadow: "0 6px 18px rgba(0,0,0,0.1)",
  padding: "2.5rem 3rem",
  maxWidth: "700px",
  width: "100%",
};

const headerSection = {
  display: "flex",
  justifyContent: "space-between",
  alignItems: "center",
  marginBottom: "2rem",
};

const titleStyle = {
  fontSize: "1.9rem",
  fontWeight: "700",
  color: "#1a237e",
};

const returnButtonStyle = {
  padding: "0.6rem 1.2rem",
  backgroundColor: "#eeeeee",
  color: "#0d47a1",
  border: "1px solid #ccc",
  borderRadius: "6px",
  cursor: "pointer",
  fontWeight: "600",
  transition: "all 0.2s ease-in-out",
};

const formSection = {
  display: "flex",
  flexDirection: "column",
  gap: "1.5rem",
};

const inputGroup = {
  display: "flex",
  flexDirection: "column",
};

const labelStyle = {
  fontWeight: "600",
  marginBottom: "0.5rem",
  color: "#333",
};

const inputStyle = {
  padding: "0.9rem",
  border: "1px solid #ccc",
  borderRadius: "6px",
  fontSize: "1rem",
};

const selectStyle = {
  ...inputStyle,
  backgroundColor: "#fff",
  cursor: "pointer",
};

const textareaStyle = {
  ...inputStyle,
  resize: "vertical",
  minHeight: "120px",
};

const createButtonContainer = {
  display: "flex",
  justifyContent: "flex-end",
};

const createButtonStyle = {
  padding: "1rem 2rem",
  backgroundColor: "#0d47a1",
  color: "#ffffff",
  border: "none",
  borderRadius: "8px",
  cursor: "pointer",
  fontWeight: "600",
  fontSize: "1rem",
  transition: "background 0.3s ease",
};

export default NewTicketForm;
